import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Header from "./components/Header";
import AppBar from '@mui/material/AppBar';
import Home from './views/Home';

function App() {
  return (
    <Router>
      <Header />
      <Switch>
        <Route path="/">
          <Home></Home>
        </Route>

      </Switch>
    </Router>
  );
}

export default App;
